export default function CompanyContactCard() {
    return (
        <div className='column'>
            <div className='line-item'>
                email us: 
                support@accretion.life
                <a href={mailtoUrl}>
                    {children ? children : `Send Email to ${emailAddress}`}
                </a>
            </div>
            <div className='line-item'>
                call us: 
                720-225-7668
            </div>
        </div>
    )
}
